This interface sits between a serial byte encoding component and a
framing/packetizing component. It is to be used with framing protocols
that place delimiters between frames. This interface separates the tasks
of interpreting and coding delimiters and escape bytes from the rest of
the wire protocol.

@author Philip Levis
@author Ben Greenstein
@date   August 7 2005

Used by the upper layer to request that a byte of data be sent
over serial.
@param data The byte to be sent
@return Returns an error_t code that indicates if the lower layer
has accepted the byte for sending (SUCCESS) or not (FAIL).

The dispatcher may initiate a serial transmission by calling this function
and passing the first byte to be transmitted.
@param first_byte The first byte to be transmitted.
@return Returns an error_t code indicating either that the framer
has the resources available to transmit the frame (SUCCESS) or
not (EBUSY).

This is the data interface that a serial protocol provides and
a serial dispatcher uses. The dispatcher expects the following pattern
of calls: ((startPacket)+ (byteReceived)* (endPacket)+)*
It should ignore any signals that do not follow this pattern.
The interface is used to separate the state machine of the wire protocol
from the complexities of dispatch.

@author Philip Levis
@author Ben Greenstein
@date August 7 2005

Signals the upper layer that a byte of the encapsulated packet has been
received. Passes this byte as a parameter to the function.
@param data A byte of the encapsulated packet that has been received.

Begin transmission of a UART stream. If SUCCESS is returned,
<code>sendDone</code> will be signalled when transmission is
complete.

@param 'uint8_t* COUNT(len) buf' Buffer for bytes to send.
@param len Number of bytes to send.
@return SUCCESS if request was accepted, FAIL otherwise.

Begin reception of a UART stream. If SUCCESS is returned,
<code>receiveDone</code> will be signalled when reception is
complete.

@param 'uint8_t* COUNT(len) buf' Buffer for received bytes.
@param len Number of bytes to receive.
@return SUCCESS if request was accepted, FAIL otherwise.

Enable the receive byte interrupt. The <code>receive</code> event
is signalled each time a byte is received.

@return SUCCESS if interrupt was enabled, FAIL otherwise.

Signal completion of receiving a stream.

@param 'uint8_t* COUNT(len) buf' Buffer for bytes received.
@param len Number of bytes received.
@param error SUCCESS if the reception was successful, FAIL otherwise.

Signal completion of sending a stream.

@param 'uint8_t* COUNT(len) buf' Bytes sent.
@param len Number of bytes sent.
@param error SUCCESS if the transmission was successful, FAIL otherwise.

Send a single uart byte. The call blocks until it is ready to
accept another byte for sending.

@param byte The byte to send.
@return SUCCESS if byte was sent, FAIL otherwise.

Receive a single uart byte. The call blocks until a byte is
received.

@param 'uint8_t* ONE byte' Where to place received byte.
@param timeout How long in byte times to wait.
@return SUCCESS if a byte was received, FAIL if timed out.

